def parse_response(data):
    columns = data['columns']
    rows = data['rows']

    # Determine data types for each column based on the first row's values
    column_data_types = {}
    for column in columns:
        first_row_value = rows[0][column]
        if re.match(r'^\d+$', first_row_value):
            column_data_types[column] = int
        elif re.match(r'^\d+\.\d+$', first_row_value):
            column_data_types[column] = float
        elif re.match(r'^\d{4}-\d{2}-\d{2}', first_row_value):
            column_data_types[column] = parser.parse
        else:
            column_data_types[column] = str

    # Convert string values in all rows to their appropriate data types
    for row in rows:
        for column, value in row.items():
            if column in column_data_types:
                data_type = column_data_types[column]
                if data_type == int:
                    row[column] = int(value)
                elif data_type == float:
                    row[column] = float(value)
                elif data_type == parser.parse:
                    row[column] = parser.parse(value)

    # Prepare the output dictionary with enriched data
    enriched_data = {'columns': [], 'rows': []}
    for column in columns:
        enriched_data['columns'].append({'name': column, 'data_type': column_data_types[column], 'friendly_name': column})

    enriched_data['rows'] = rows

